	$scope.openMWPhotoBrowser = function (){
		// var data = angular.module('starter.photoProvider', []);
		
		try{
			// console.log($scope.photos.photos[0]);
			
			var images = [];
			var thumbnails = [];
			/*
			{
				images:images,
				index: 1,
				startOnGrid:true,
				meta:{}

			}
			*/
			for (var i = 0; i < $scope.photos.photos.length ; i++){
				images.push($scope.photos.photos[i].previewUrl);
				thumbnails.push($scope.photos.photos[i].thumbnailUrl);
			}

			var options = {
				'images' : images,
				'thumbnails' : thumbnails,
				'index':1
			}
			window.plugins.mwPhotoBrowser.showGallery(
			options , function (result){
				console.log('result : ' + result);
			});
		}catch(exc){
			console.log(exc);
		}
		
	}

	$scope.getPicture = function (){
		try{
			options ={
				maximumImagesCount: 15,
				width: 0,
				height: 0,
				quality: 100,
				title: "Albums"
			}
			$window.imagePicker.getPictures(function (success) {
				console.log('success : ' + JSON.stringify(success));
				$scope.photos = success.images;
			},
			function (fail) {
				console.log('fail : ' + fail);
			},
			{ 
				correctOrientation:true,
				saveToPhotoAlbum:true
			});
		}catch(exc){
			console.log(exc);
		}
		
	}
